import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Title from './Components/JSXcomponents/Title';
import Homepage from './Components/JSXcomponents/Homepage';
import AddRoom from './Components/JSXcomponents/AddRoom';
import Room from './Components/JSXcomponents/Room';
import { useState } from 'react';

function App() {

  const [rooms, setRooms] = useState([]);

  return (

    <div className="App">
      <Title></Title>
      <BrowserRouter>
        <Routes>
          <Route path='/' element={<Homepage rooms={rooms} setRooms={setRooms} />}></Route>
          <Route path='/addroom' element={<AddRoom rooms={rooms} setRooms={setRooms} />}></Route>
          <Route path='/room' element={<Room rooms={rooms} setRooms={setRooms} />}></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
